function ExpenseItem() {
  return (
    <div>
      <h2> Expense Item!</h2>
      <h3> Date: 5th October</h3>
      <p>Food Rs 10</p>

      <p>Petrol Rs 100</p>

      <p>Movies Rs 200</p>
    </div>
  );
}

export default ExpenseItem;
